window.bookSummaryJSON = "<p>The deadliest unpaid intern in the galaxy </p> <p>Some people struggle to get to college. Tanner Malone had to fight through an interstellar war. Far from home, under a cloud of scandal and propaganda, hunted by assassins and haunted by trauma, Tanner is finally enrolled in a top university. </p> <p>He didn’t plan for an archaeological expedition on the far side of human space. He didn’t want more corporate mercenaries or space pirates in his life, either. Yet ancient alien secrets don’t come without cost. If his classmates want to survive the summer, their infamous intern is the only chance they’ve got.</p>"; 
